var hl=require("highlight.js");module.exports=exports=function(e){e.filters.js=function(e){e=e.replace(/\\n/g,"\n");var t=hl.highlight("javascript",e).value,n='<pre><code class="javascript">'+t.replace(/\n/g,"\\n")+"</code></pre>";return n};e.filters.bash=function(e){var t=hl.highlight("bash",e.replace(/\\n/g,"\n")).value,n='<pre><code class="bash">'+t+"</code></pre>";return n}};